import React from 'react';
import {
  StyleSheet,
  Text,
  View,
  SafeAreaView,
  Button,
  ImageBackground,
  Platform,
  StatusBar,
  Image,
} from 'react-native';

const WelcomeScreen = () => {
  return (
    <ImageBackground
      style={styles.background}
      source={require('../assets/farmerMarket.jpg')}
    >
      <View style={styles.textContainer}>
        <Text>Local Online</Text>
        <Text>Organic goodness from your Computer</Text>
      </View>
      <View style={styles.loginButton}></View>
      <View style={styles.registerButton}></View>
    </ImageBackground>
  );
};

const styles = StyleSheet.create({
  background: {
    flex: 1,
    justifyContent: 'flex-end',
    alignItems: 'center',
  },
  loginButton: {
    width: '100%',
    height: 70,
    backgroundColor: 'tomato',
  },

  registerButton: {
    width: '100%',
    height: 70,
    backgroundColor: 'green',
  },
  textContainer
});

export default WelcomeScreen;
